 @isaquesorriso6816  Vc está certo. Não só levou p a final da Sula, como tb do Paulista, e passou vergonha em ambas. O time jogava feio, na chuveirada na área e o Calleri/Luciano brigando na área. E isso era pq ele, Rogério, não enxergava outra forma do time jogar. É nesse ponto que ele precisa evoluir. O Dorival está provando que o SP pode jogar diferente, fazendo triangulações e envolvendo o time adversário. O jogo do Ceni era de toque de bola, mas sempre jogando p linha fundo e cruzando.
Na Sula, ele foi arrogante p caramba,  dizendo que o adversário desculpasse, mas que o título seria do SP. Foi lá e passou vergonha no débito e no crédito. 
É a realidade. O Ceni é  um cara fenomenal, mas como técnico, precisa se desenvolver mais.
